import React from 'react'

const Report = () => {
  return (
    <div>
      <div className="card-container">
        <Card title="Pending" count="5" />
        <Card title="Completed" count="10" />
        <Card title="Canceled" count="7" />
      </div>
    </div>
  );
}

export default Report
